import React from "react";
import { Link } from "react-router-dom";
import ShowImage from "./ShowImage"

const Card = ({ vegetable }) => {
    return (
        <div className="col-4 mb-3">
            <div className="card">
                <div className="card-header">{<strong>vegetable.name</strong>}</div>
                <div className="card-body">
                    <ShowImage item={vegetable} url="vegetables" />
                    <p>${vegetable.price}</p>
                    <Link to="/">
                        <button className="btn btn-outline-primary mt-2 mb-2 mr-5">
                            View Vegetable
                        </button>
                    </Link>
                    <button className="btn btn-outline-warning mt-2 mb-2 mr-2">
                        Add to cart
                    </button>
                </div>
            </div>
        </div>
    );
};

export default Card;
